import React from "react";

function Conditionnnal(props){
    console.log(props.isLoaded)
    if(props.isLoaded==false){
        return(
            <h1>Loading ...</h1>
        )
    }
    return(
        <h1>Completed</h1>
    )

}

export default Conditionnnal
